" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Other Pseudomonas aeruginosa infections",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?31/47/32503/contributors\">",
