" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 500px\">",
"   <div class=\"ttl\">",
"    Calcium absorption in relation to calcium intake",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 480px; height: 250px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Effect of increasing calcium intake on net calcium absorption as estimated from the rise in urinary calcium excretion (measured in units of mg/dL of glomerular filtration in the second two hours after the calcium load). Going above single doses higher than 500 mg leads to a minor further increment in calcium excretion. In addition, calcium citrate is associated with a significantly higher rate of calcium absorption at doses of 0.5 g or higher.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Harvey, JA, Zobitz, MM, Pak, CY, J Bone Miner Res 1988; 3:253.",
